// Array of image URLs
const images = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTXTlLr1zgEatIdq2Jvui9X_9_gECcU7vaXe7ggGPjEgGfVoK6mfHGjze0&s",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRGJSe0J1ZlTTfGAr3Wi7UK-eBOJR4a893oBV4bYLHqzquwhYUvK_HyfoU&s"
];

let currentIndex = 0;
const sliderImage = document.getElementById("sliderImage");

// Function to update the image
function updateImage() {
    sliderImage.src = images[currentIndex];
}

// Next Image
function nextImage() {
    currentIndex = (currentIndex + 1) % images.length;
    updateImage();
}

// Previous Image
function prevImage() {
    currentIndex = (currentIndex - 1 + images.length) % images.length;
    updateImage();
}

// Initialize the first image
updateImage();
